export default class Resource {

    private static _kiritan_sit: string = "";
    private static _kiritan_fly: string = "";
    private static _zunda: string = "";
    private static _alarm: string = "";

    private static _notifyIcon: string = "";

    static kiritan_sit(): HTMLImageElement {
        var img = document.createElement('img');
        img.setAttribute('src', "data:image/png;base64," + Resource._kiritan_sit);
        return img;
    }

    static kiritan_fly(): HTMLImageElement {
        var img = document.createElement('img');
        img.setAttribute('src', "data:image/png;base64," + Resource._kiritan_fly);
        return img;
    }

    static zunda(): HTMLImageElement {
        var img = document.createElement('img');
        img.setAttribute('src', "data:image/png;base64," + Resource._zunda);
        return img;
    }

    static alarm(): HTMLAudioElement {
        var audio = document.createElement('audio');
        audio.src = "data:audio/mp3;base64," + Resource._alarm;
        return audio;
    }

    static notifyIcon(): string {
        var icon = "data:image/png;base64," + Resource._notifyIcon;
        return icon;
    }
}